(1, '2004-01-01 12:00:00', 'This is the first news post. Please use the admin control panel to add another one and make this one go away.'),
(2, '2010-05-08 01:05:19', 'Boas vindas galera! Estamos come?ando o Naruto! Nigeru RPG! Em breve mais novidades, tal como sistema de batalha entre dois jogadores e ainda sistema de trocas para itens! At? a pr?xima galerinha!'),
(3, '2010-05-12 02:01:32', 'Ol? galera, estamos dando in?cio ao jogo Naruto! Nigeru RPG! Agora mesmo! Bem, queria deixar bem claro, que ainda est? em Beta test, pode haver algumas mudancinhas... De qualquer forma, espero que aproveitem o jogo!'),
(4, '2010-05-12 22:01:01', 'Galera, a restri??o de postar 25% do dinheiro por vez no banco foi retirada. Agora voc? pode postar TUDO. Aproveitem enquanto n?o mudamos isso.\r\n\r\nO bonus de Mem?ria de Konoha e Fartura de Konoha passam de 10% pra 20%. Aproveitem.'),
(5, '2010-05-12 22:03:22', 'Galera, a restri??o de postar 25% do dinheiro por vez no banco foi retirada. Agora voc? pode postar TUDO. Aproveitem enquanto n?o mudamos isso. Talvez a taxa ?nica de pagamento ao Banco aumente mais tarde.\r\n\r\nO bonus de Mem?ria de Konoha e Fartura de Konoha passam de 10% pra 20%. Aproveitem.'),
(6, '2010-05-12 22:12:09', 'Galera, a restri??o de postar 25% do dinheiro por vez no banco foi retirada. Agora voc? pode postar TUDO. Aproveitem enquanto n?o mudamos isso. Talvez a taxa ?nica de pagamento ao Banco aumente mais tarde.'),
