(8, '2010-05-13 14:34:45', 'Galera, a restri??o de postar 25% do dinheiro por vez no banco foi retirada. Agora voc? pode postar TUDO. Aproveitem enquanto n?o mudamos isso. Talvez a taxa ?nica de pagamento ao Banco aumente mais tarde.\r\n\r\nLembrando galera que o jogo ainda est? em Beta Test e PODE haver algumas mudan?as. Obrigado.\r\n\r\nGalera desculpa essas propagandas, pop ups, coisas do g?nero, ? a hospedagem... T? tentando dar uma resolvida nisso.'),
(9, '2010-05-17 22:50:46', 'Galera, a restri??o de postar 25% do dinheiro por vez no banco foi retirada. Agora voc? pode postar TUDO. Aproveitem enquanto n?o mudamos isso. Talvez a taxa ?nica de pagamento ao Banco aumente mais tarde.\r\n\r\nLembrando galera que o jogo ainda est? em Beta Test e PODE haver algumas mudan?as. Obrigado.\r\n\r\nGalera desculpa essas propagandas, pop ups, coisas do g?nero, ? a hospedagem... T? tentando dar uma resolvida nisso.\r\n\r\nEm breve mais novidades para o RPG, como sistema de miss?es, avatares, sistema de gradu??o(Genin, Chuunin, etc) e um layout totalmente novo!'),
